Secrets of Highclere Castle

History Documentary hosted by Samuel West, published by PBS broadcasted as part of PBS Secrets of The Manor House series in 2013 - English narration


Information
------------------------------

It may be more famous now than any time in its 1,300-year history as the setting of Downton Abbey, but England's Highclere Castle has its own stories to tell. In its heyday, Highclere was the social epicenter of Edwardian England. See how all the inhabitants of Highclere lived, from the aristocrats who enjoyed a life of luxury to the army of servants toiling &quot;below stairs.&quot; Also find out how the current inhabitants, Lord and Lady Carnarvon, spend their $1 million in annual upkeep funds, and what life in a fairytale castle is like today.

